import React from "react";
import { Header } from "../components/HeaderLoginManager";
import { LoginManager } from "../components/LoginManager";

function ManagerLoginPage() {
  return (
    <React.Fragment>
        <header>

          <Header />

        </header>

        <main>

          <LoginManager />

        </main>

    </React.Fragment>
  );
}


export {ManagerLoginPage};
